package de.db.dbsearch.common;



/**

 * A list of all document field names used.

 */

public interface DocumentFieldNames {



    /**

     * This field stores a <strong>unique</strong>

     * identifier associated with a document. This identifier is usually the document URI.

     * The identifier is not required to be a valid URL for locating the document in the

     * source system. Use {@link #DBSEARCH_LINK} for that purpose.

     * 

     * Every Document <strong>must</strong> provide a value for the identifier, 

     * otherwise adding this document will fail.

     */

    String SOLR_ID = "id";



    /**

     * This field stores document URL locating the document in the source system.

     * It is used to link the search result item to original document in the source system.

     * 

     * The field is mandatory.

     */

    String DBSEARCH_LINK = "dbsearch_link_s";



    /**

     * This field stores document type (see DocumentType).

     * It is used for filtering. (e.g. to separate normal documents from media documents)

     */

    String DBSEARCH_DOCTYPE = "dbsearch_doctype_s";



    /**

     * This field stores the attributes allows to categorizes document (e.g. to display documents

     * in specific result tab).

     */

    String DBSEARCH_CLASSIFIERS = "dbsearch_classifier_ss";



    /**

     * This field stores the technical source system name and is supposed to be identical

     * for all documents originating from the same source system.

     * 

     * The field is mandatory.

     */

    String DBSEARCH_SOURCE_TYPE_S = "dbsearch_source_type_s";



    /**

     * This field stores the speaking source name of the source system. 

     * It is usually displayed as top level entry in the source facet.

     * 

     * The field is mandatory.

     */

    String DBSEARCH_SOURCE_NAME = "dbsearch_source_name_s";



    /**

     * This field stores the space identifer in the source. 

     * A space is a subdivision (e.g. Wiki space, ECM site, etc.) in the source system that the document belongs to. 

     * 

     * The field is mandatory.

     */

    String DBSEARCH_SPACE_ID = "dbsearch_space_id_s";



    /**

     * This field stores the speaking space name in the source. 

     * It is usually displayed as second level entry in the source facet.

     * 

     * The field is mandatory.

     */

    String DBSEARCH_SPACE_NAME = "dbsearch_space_name_t";



    /**

     * This field indexes a value combined from {@link #DBSEARCH_SOURCE_NAME} and {@link #DBSEARCH_SPACE_NAME}.

     * The path separator is &quot;/&quot;.

     * It is used for computing the source facet more efficiently.

     * 

     * The field is computed automatically.

     */

    String DBSEARCH_SOURCEPATH = "dbsearch_source_path";





    /**

     * This field indexes the local path in the source system (separated with &quot;/&quot;).

     *

     * The field is computed automatically.

     */

    String DBSEARCH_TAXONOMY_HIERACHY_PATH  = "dbsearch_taxonomy_hierarchy_path";



    /**

     * This field stores the document title

     * 

     * The field is mandatory.

     */

    String DBSEARCH_TITLE = "dbsearch_title_t";



    /**

     * This field stores the document title extracted from the documents binary content.

     * 

     * The field is computed automatically.

     */

    String DBSEARCH_EXTRACTED_TITLE = "dbsearch_extracted_title_t";

    

    /**

     * This field stores textual summary of the document's content.

     * 

     * The field is optional.

     */

    String DBSEARCH_ABSTRACT = "dbsearch_abstract_t";



    /**

     * This field stores the name of the document author.

     * It is usually displayed in the result item.

     * 

     * The field is optional.

     */

    String DBSEARCH_AUTHOR = "dbsearch_author_t";



    /**

     * This field stores the document's author extracted from the documents binary content.

     * 

     * The field is computed automatically.

     */

    String DBSEARCH_EXTRACTED_AUTHOR = "dbsearch_extracted_author_t";



    /**

     * This field stores the untokenized name of the document author.

     * It is used for the author facet.

     * 

     * The field is computed automatically.

     */

    String DBSEARCH_AUTHOR_UNTOKENIZED = "dbsearch_author_ss";



    /**

     * This field stores the publication date of the document.

     * It is usually displayed in the result item and used for the date facet.

     * 

     * If not set, fill with fallback from the following fields:

     * <ul>

     * <li>{@link #DBSEARCH_EXTRACTED_PUB_DATE}</li>

     * <li>{@link #DBSEARCH_EXTRACTED_MOD_DATE}</li>

     * </ul>

     * 

     * The field is optional.

     */

    String DBSEARCH_PUB_DATE = "dbsearch_pub_date_tdt";



    /**

     * This field stores the document's publication date extracted from the documents binary content.

     * 

     * The field is computed automatically.

     */

    String DBSEARCH_EXTRACTED_PUB_DATE = "dbsearch_extracted_pub_date_tdt";



    /**

     * This field stores the modification date of the document.

     * 

     * The field is optional.

     */

    String DBSEARCH_MOD_DATE = "dbsearch_mod_date_tdt";



    /**

     * This field stores the document's modification date extracted from the documents binary content.

     * 

     * The field is computed automatically.

     */

    String DBSEARCH_EXTRACTED_MOD_DATE = "dbsearch_extracted_mod_date_tdt";



    /**

     * This field stores the name of the document keywords.

     * It is usually displayed in the result item.

     * 

     * The field is optional.

     */

    String DBSEARCH_KEYWORDS = "dbsearch_keywords_txt";



    /**

     * This field stores the name of the document taxonomies (e.g. Navigation names).

     * 

     * The field is optional.

     */

    String DBSEARCH_TAXONOMIES = "dbsearch_taxonomies_txt";



    /**

     * This field stores the untokenized keywords of the document.

     * It is used for the keyword facet.

     * 

     * The field is computed automatically.

     */

    String DBSEARCH_KEYWORDS_UNTOKENIZED = "dbsearch_keywords_ss";



    /**

     * This field stores the first 25000 chars copied from {@link #DBSEARCH_CONTENT}.

     * It is used for the highlighting the hit in the result snippet.

     * 

     * The field is computed automatically.

     */

    String DBSEARCH_HIGHLIGHT = "dbsearch_highlight_t";  



    /**

     * This field stores the first 200 chars copied from {@link #DBSEARCH_CONTENT}.

     * It is used as fallback result snippet, when highlighting was not possible.

     * 

     * The field is computed automatically.

     */

    String DBSEARCH_EXCERPT = "dbsearch_excerpt_s";



    /**

     * This field stores terms used for autocomplete and did you mean

     * 

     * The field is computed automatically. Terms are copied from the fields

     * <ul>

     * <li>{@link #DBSEARCH_CONTENT}</li>

     * <li>{@link #DBSEARCH_TITLE}</li>

     * <li>{@link #DBSEARCH_EXTRACTED_TITLE}</li>

     * <li>{@link #DBSEARCH_ABSTRACT}</li>

     * <li>{@link #DBSEARCH_AUTHOR}</li>

     * <li>{@link #DBSEARCH_EXTRACTED_AUTHOR}</li>

     * <li>{@link #DBSEARCH_KEYWORDS}</li>

     * <li>{@link #DBSEARCH_TAXONOMIES}</li>

     * </ul>

     */

    String DBSEARCH_SUGGEST = "dbsearch_suggest_de";



    /**

     * This field indexes the complete document content.

     * 

     * The field is optional.

     */

    String DBSEARCH_CONTENT = "dbsearch_content_t";





    /**

     * This field stores binary size of the document's content in bytes.

     * 

     * The field is mandatory.

     */

    String DBSEARCH_CONTENT_SIZE = "dbsearch_content_size_l";



    /**

     * This field stores the MIME type of the document's content.

     * 

     * The field is optional.

     */

    String DBSEARCH_CONTENT_TYPE = "dbsearch_content_type_s";



    /**

     * This field indexes invisible content. The field is searchable, but the

     * the field's content will not be visible to the search user.

     * 

     * The field is optional.

     */

    String DBSEARCH_HIDDEN_CONTENT = "dbsearch_hidden_content_t";

    

    /**

     * This field stores a aggregated representation of the document's MIME type.

     * 

     * The field is computed automatically. (see mime-aggregation.properties)

     */

    String DBSEARCH_CONTENT_TYPE_AGGREGATED = "dbsearch_content_type_aggregated_s";



    /**

     * This field stores the language of a document. The field is optional.

     *

     * Use the language shortcode here, e.g. 'de' or 'en'.

     */

    String DBSEARCH_LANGUAGE    = "dbsearch_language_s";



    /**

     * This field indexes the start date of a time based validity period. The field ist optional.

     * 

     * defaults to "1970-01-01T00:00:00.000Z"

     */

    String DBSEARCH_VALID_FROM_DATE = "dbsearch_valid_from_date_tdt";

    

    /**

     *  This field indexes the end date of a time based validity period. The field ist optional.

     * 

     * Defaults to "9999-12-31T23:59:59.999Z"

     */

    String DBSEARCH_VALID_TO_DATE = "dbsearch_valid_to_date_tdt";

    

    /**

     * This field indexes the document level access tokens.

     * 

     * The field is optional. (refer to Apache ManifoldCF for more information)

     */

    String MANIFOLD_ALLOW_TOKENS = "allow_token_document";



    /**

     * This field indexes the space level access tokens.

     * 

     * The field is optional. (refer to Apache ManifoldCF for more information)

     */

    String MANIFOLD_SPACE_ALLOW_TOKENS = "allow_token_share";



    /**

     * This field indexes the document level deny tokens.

     * 

     * The field is optional. (refer to Apache ManifoldCF for more information)

     */

    String MANIFOLD_DENY_TOKENS = "deny_token_document";



    /**

     * This field indexes the space level deny tokens.

     * 

     * The field is optional. (refer to Apache ManifoldCF for more information)

     */

    String MANIFOLD_SPACE_DENY_TOKENS = "deny_token_share";



    /** 

     * This field stores a base64 encoded thumbnail image.

     * 

     * The field is optional.

     */

    String DBSEARCH_THUMBNAIL_DATA = "dbsearch_thumbnail_data";



    /** 

     * This field stores the src URL of the thumbnail.

     * 

     * The field is optional.

     */

    String DBSEARCH_IMAGE_URL = "dbsearch_image_url";



    /** 

     * This field stores URL locating the document in the source system referring to the image.

     * It is used to link the search result image to original document in the source system.

     * 

     * The field is optional.

     */

    String DBSEARCH_IMAGE_LINK = "dbsearch_image_link";



    /** 

     * This field stores the width of the image in pixels.

     * 

     * The field is optional.

     */

    String DBSEARCH_IMAGE_WIDTH = "dbsearch_image_width";



    /** 

     * This field stores the height of the image in pixels.

     * 

     * The field is optional.

     */

    String DBSEARCH_IMAGE_HEIGHT = "dbsearch_image_height";



    /** 

     * This field stores the image format. (e.g. jpeg, png, etc.)

     * 

     * The field is optional.

     */

    String DBSEARCH_IMAGE_FORMAT = "dbsearch_image_format";



    /**

     * This field stores the image color depth.

     * 

     * The field is optional.

     */

    String DBSEARCH_IMAGE_DEPTH = "dbsearch_image_depth";



    /**

     * This field stores the image size in bytes.

     * 

     * The field is optional.

     */

    String DBSEARCH_IMAGE_SIZE = "dbsearch_image_size";



}
